import React from 'react'
import './aboutus.css'
import aboutimg from './images/banner4image.jpg'
import Button from 'react-bootstrap/Button';
function aboutus() {
  return (
    <div className='about'>
    <img src={aboutimg} className='aboutimg'></img>
    <div className='about-texts'>
    <h1>BEST INSTRUCTOR</h1>
    <p>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Quaerat illum velit eveniet. Optio, illum sequi dolor sit amet consectetur adipisicing elit.?</p>
    <Button variant="outline-">READ MORE</Button>{' '}
    </div>
    
   
    </div>
  )
}

export default aboutus
